// iniciar datatable para logbook y permitir la descarga de documento pdf personalizado
$(document).ready(function () {
    $('#logbooks').DataTable({
        dom: 'Bfrtip',
        buttons: [{
            extend: 'pdfHtml5',
            title: 'Libro de entrada',
            // text: '<svg xmlns="http://www.w3.org/2000/svg" width="16" height="16" fill="#000" class="bi bi-download" viewBox="0 0 16 16"><path d="M.5 9.9a.5.5 0 0 1 .5.5v2.5a1 1 0 0 0 1 1h12a1 1 0 0 0 1-1v-2.5a.5.5 0 0 1 1 0v2.5a2 2 0 0 1-2 2H2a2 2 0 0 1-2-2v-2.5a.5.5 0 0 1 .5-.5z"/><path d="M7.646 11.854a.5.5 0 0 0 .708 0l3-3a.5.5 0 0 0-.708-.708L8.5 10.293V1.5a.5.5 0 0 0-1 0v8.793L5.354 8.146a.5.5 0 1 0-.708.708l3 3z"/>PDF</svg>',
            customize: function (doc) {

                // Splice the image in after the header, but before the table
                doc.content.splice(0, 0, {
                    margin: [0, 0, 0, 40],
                    alignment: 'center',
                    image: 'data:image/png;base64,',
                    width: 100,
                });

                doc['footer'] = (function (page, pages) {
                    return {
                        columns: [
                            'Aulario | Libro de entrada',
                            {
                                alignment: 'right',
                                text: [
                                    { text: page.toString(), italics: true },
                                    ' de ',
                                    { text: pages.toString(), italics: true }
                                ]
                            }
                        ],
                        margin: [10, 0]
                    }
                });
            }
        }
    , 'csv']
    });
});